import  React  from "react";
import {ProgressBar} from 'primereact/progressbar';


class Rates extends React.Component{
    constructor(props)
    {
        super();
        this.state={data:[]};
    }

    componentDidMount(){
        this.structureData();
    }

   async structureData(){
         let data=[];

        //find the highest active cases rate
        Object.keys(this.props.data.data).forEach((x,index)=>{
            if(index==0){
                data.push(
                {name:x,percent:((this.props.data.data[x].confirmed[this.props.data.data[x].confirmed.length-1][1]-this.props.data.data[x].recovered[this.props.data.data[x].recovered.length-1][1]-this.props.data.data[x].deaths[this.props.data.data[x].deaths.length-1][1])*100).toFixed(2)},
                {name:x,percent:((this.props.data.data[x].recovered[this.props.data.data[x].recovered.length-1][1]/this.props.data.data[x].confirmed[this.props.data.data[x].confirmed.length-1][1])*100).toFixed(2)},
                {name:x,percent:((this.props.data.data[x].deaths[this.props.data.data[x].deaths.length-1][1]/this.props.data.data[x].confirmed[this.props.data.data[x].confirmed.length-1][1])*100).toFixed(2)}
                )
            }
        });
        await this.setState({data:data});
        console.log(this.state.data);

    }


    render(){
        return(
            <div className="col-xl-3 col-md-12">
              <div className="card p-disabled" style={{height:"360px"}}>
                <div className="card-body">
                    <span style={{float:"left"}}>Highest Active Rate</span>
                    <hr style={{border:"2px solid rgb(124, 181, 236)"}}></hr>
                    <span style={{float:"left"}}>{this.state.data[0].name}</span>
                    <span style={{float:"right",color:"#ef3c3c"}}>{}%</span>
                    <br></br><br></br><br></br>
                    <span style={{float:"left"}}>Highest Recovery Rate</span>
                    <hr style={{border:"2px solid #009933"}}></hr>
                    <span style={{float:"left"}}>{}</span>
                    <span style={{float:"right",color:"#009933"}}>{}%</span>
                    <br></br><br></br><br></br>
                    <span style={{float:"left"}}>Highest Death Rate</span>
                    <hr style={{border:"2px solid red"}}></hr>
                    <span style={{float:"left"}}>{}</span>
                    <span style={{float:"right",color:"red"}}>{}%</span>

                </div>
              </div>
            </div>
        )
    }
}

export default Rates;
